'use client'
import React, { useEffect, useState } from "react";
import Cards from "../cards/cards";
import Link from "next/link";
import "./careers.modules.css"; 
import axios from "axios";
import NoLogin from "../NoLogin/NoLogin";

const ComponenteTarjeta = ({src, title}) => {

  const [token, setToken] = useState("");
  const [programs, setPrograms] = useState([]);

  useEffect(() => {
    if (typeof window !== "undefined") {
      const localToken = localStorage.getItem("token");
      if (localToken) {
        setToken(localToken);
      }
    }
  }, []);

  useEffect(() => {
    if(token.length > 0 ) {
      axios.get(`${process.env.NEXT_PUBLIC_API_URL}/programs`, {headers: {Authorization: `Bearer ${token}`}})
      .then((res) => {
        setPrograms(res.data)
      })
    }
  }, [token])

  return (
    <div className="componente-tarjeta">
      <div className="title-container">
        <h2>Carreras / Cursos</h2>
        <div className="verTodosBtn">
          {programs?.length}
        </div>
      </div>
      <div className="scroll-horizontal">
        {programs.length === 0 ? 
          (
            <NoLogin />
          ) 
        : 
          (programs?.map((program) => (
            <Cards id={program.id} title={program.name} src={'https://www.viewsonic.com/library/wp-content/uploads/2020/08/LB0174-e1602142212898.jpg'} url={'carrera'} />
          )))
        }
        {/* <Cards    
          src={"data:image/jpeg;base64,"}
          title={"Pedagogía"}
        />

        <Cards 
          src={"data:image/jpeg;base64,"}

          title={"Medicina"}
        />

        <Cards 
          src={"data:image/jpeg;base64,"}
          title={"Mecanica"}
        />

        <Cards 
          src={"data:image/jpeg;base64,"}
          title={"Ingenieria"}
        />

        <Cards 
          src={"data:image/jpeg;base64,"}
          title={"Enfermería"}
        /> */}
      </div>
    </div>
  );
};

export default ComponenteTarjeta;
